import { ModalController, NavController } from '@ionic/angular';
import { Component, OnInit } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Component({
  selector: 'app-modal-permissao',
  templateUrl: './modal-permissao.page.html',
  styleUrls: ['./modal-permissao.page.scss'],
})
export class ModalPermissaoPage implements OnInit {

  public fGroupPermissao: FormGroup;

  constructor(
    private modalCtrl: ModalController,
    private fBuilder: FormBuilder
  ) {
    this.fGroupPermissao = this.fBuilder

  }

  close() {
    this.modalCtrl.dismiss();
  }

  novaPermissao(){

  }

  ngOnInit() {
  }

}
<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back-outline" style="color: black;" (click)="close()"></ion-icon>
      <div id="logo">
        <img src="assets/icon/moio.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>

  <form [formGroup]="fGroupPermissao">
    <div id="textPermissao">
      <h1>Nova Permissão</h1>
      <p>Registre funções na sua conta para facilitar a organização.</p>
      <div id="informacoes">
        <ion-input label="Nome" formControlName="nome" labelPlacement="floating" [counter]="true" maxlength="40" helperText="Digite seu Nome"></ion-input>
        <ion-input type="email" formControlName="emailPermissao" fill="solid" label="Email" labelPlacement="floating" helperText="Digite um E-mail valido" errorText="E-mail Invalido" ngModel email></ion-input>
      </div>
      <div id="funcoes">
        <h1>Funções</h1>
        <div id="selectsFuncoes">
          <ion-checkbox name="criar" formControlName="criarNew">Criar novo local</ion-checkbox><br>
          <ion-checkbox name="acess" formControlName="acessPermissao">Acessar permissões</ion-checkbox>
        </div>
      </div>
    </div>
  <ion-button shape="round" name="enviar" (click)="novaPermissao()">Enviar Solicitação de permissão</ion-button>

  </form>
